import React from "react";
import HomeButton from "./HomeButton";
export const Header = () => {
  return (
    <div className=" bg-orange w-full h-7 flex justify-between  items-center pl-[2px] pr-2">
      <div className="flex gap-2">
        <div className="border border-white w-6 h-6 flex items-center justify-center ]">
          <img className="w-fit h-5" src="/assets/hacker.svg" />
        </div>
        <span className="font-bold"> Hacker news</span>
        <HomeButton value="new" />
        <HomeButton value="past" />
        <HomeButton value="co" />
        <button>ask </button> <span> |</span>
        <button>show </button> <span> |</span>
        <button>jobs </button> <span> |</span>
        <button>submit </button> <span> |</span>
      </div>
      <div>
        <button>login</button>
      </div>
    </div>
  );
};
